<?phpnamespace Nemundo\Meteo\Dwd\Data\MapType;class MapTypePaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var MapTypeModel*/public $model;public function __construct() {parent::__construct();$this->model = new MapTypeModel();}/*** @return MapTypeRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new MapTypeRow($dataRow, $this->model);$list[] = $row;}return $list;}}